  flexcop_dma_config(fc, &fc_pci->dma[1], FC_DMA_2);
  flexcop_dma_config_timer(fc, FC_DMA_1, 0);
  flexcop_dma_xfer_control(fc, FC_DMA_1,
    FC_DMA_SUBADDR_0 | FC_DMA_SUBADDR_1, 1);
  ;

